import React, { Component } from "react";
import styled from "styled-components";
import Menubar from './hoc/Menu/Menubar';

class App extends Component {
  state = {
    page: 0
  };
  showPage = no => {
    this.setState({ page: no});
  };
  render() {
    return <div> 
      <Menubar showPage={this.setState}/>
    </div>;
  }
}

export default App;
